'use client'
import React, { useEffect, useRef, useState } from 'react'
import { Avatar, Button } from 'antd'
import ReactPlayer from 'react-player'
import { useRouter } from 'next/navigation'
import { useHomeStore } from '../stores/homeStore'

const video = {
  url: 'https://player.vimeo.com/progressive_redirect/playback/873846353/rendition/540p/file.mp4?loc=external&oauth2_token_id=1747418641&signature=8d9f9377df2b7900eafa325cec9f5d8c18345d1c4df80e72fa26d537f797e2a7',
  type: 'col',
  cover:
    'data:image/jpeg;base64,',
  videoHeight: 960,
  videoWidth: 540,
}
export default function PersonCard(props) {
  const [isPlaying, setIsPlaying] = useState(false)
  const [isFollowed, setIsFollowed] = useState(false)
  // const item = useHomeStore((state) => {
  //   return state.creatorVideos.find((item) => item.id == props.id)
  // })
  // const { cover } = item.video.videoInfo
  const cover = video.cover
  const containerRef = useRef()
  const videoRef = useRef()
  const playerRef = useRef()
  const playCard = () => {
    setIsPlaying(true)
  }
  const pauseCard = () => {
    setIsPlaying(false)
  }
  const toggleFollow = () => {
    setIsFollowed((pre) => !pre)
  }
  useEffect(() => {
    const { videoWidth, videoHeight } = video
    // const { videoWidth, videoHeight } = item.video.videoInfo
    const containerHeight = 300
    const containerWidth = 220
    let scale
    if (videoHeight > videoWidth) {
      scale = videoHeight / containerHeight / (videoWidth / containerWidth)
    } else {
      scale = videoWidth / containerWidth / (videoHeight / containerHeight)
    }
    videoRef.current.style.transform = `scale(${scale})`
  })

  return (
    <div
      className="h-full w-full bg-white  rounded overflow-hidden relative"
      ref={containerRef}
      onMouseEnter={playCard}
      onMouseLeave={pauseCard}
    >
      <div
        className={`z-0 h-full w-full
          overflow-clip`}
      >
        <div className="absolute bottom-0 w-full h-3/5 z-30 text-center">
          <Avatar size={56}></Avatar>
          <h2 className="text-white text-xl font-bold mt-3 mb-3">
            {'username'}
          </h2>
          <Button
            size="large"
            style={{
              width: '160px',
              borderRadius: '5px',
              border: 0,
            }}
            onClick={toggleFollow}
            className={`${
              isFollowed
                ? 'hover:!bg-slate-200 !bg-slate-100 text-black'
                : 'hover:!bg-rose-600 !bg-rose-500 !text-white'
            } !font-bold`}
          >
            {isFollowed ? '已关注' : '关注'}
          </Button>
        </div>
        <div ref={videoRef} className="h-full w-full">
          <img
            src={cover}
            alt="cover"
            className="absolute top-1/2 -translate-y-1/2"
          />
          {isPlaying && (
            <ReactPlayer
            volume={0}
              ref={playerRef}
              width={'100%'}
              height={'100%'}
              url={video.url}
              playing={isPlaying}
              className="z-20 absolute"
            ></ReactPlayer>
          )}
        </div>
      </div>
    </div>
  )
}
